            public override void ApplyState (Gum.DataTypes.Variables.StateSave state) 
            {
                bool matches = this.ElementSave.AllStates.Contains(state);
                if (matches)
                {
                    var category = this.ElementSave.Categories.FirstOrDefault(item => item.States.Contains(state));
                    if (category == null)
                    {
                        if (state.Name == "Default") this.mCurrentVariableState = VariableState.Default;
                    }
                    else if (category.Name == "ColorCategory")
                    {
                        if(state.Name == "Gray") this.mCurrentColorCategoryState = ColorCategory.Gray;
                        if(state.Name == "Blue") this.mCurrentColorCategoryState = ColorCategory.Blue;
                        if(state.Name == "Green") this.mCurrentColorCategoryState = ColorCategory.Green;
                        if(state.Name == "Yellow") this.mCurrentColorCategoryState = ColorCategory.Yellow;
                        if(state.Name == "Red") this.mCurrentColorCategoryState = ColorCategory.Red;
                        if(state.Name == "Black") this.mCurrentColorCategoryState = ColorCategory.Black;
                        if(state.Name == "TransparentBlack") this.mCurrentColorCategoryState = ColorCategory.TransparentBlack;
                    }
                }
                base.ApplyState(state);
            }
            public ColoredFrameRuntime (bool fullInstantiation = true, bool tryCreateFormsObject = true) 
            	: base(false, tryCreateFormsObject)
            {
                this.HasEvents = false;
                this.ExposeChildrenEvents = true;
                if (fullInstantiation)
                {
                    Gum.DataTypes.ElementSave elementSave = Gum.Managers.ObjectFinder.Self.GumProjectSave.Components.First(item => item.Name == "DefaultForms/ColoredFrame");
                    this.ElementSave = elementSave;
                    string oldDirectory = FlatRedBall.IO.FileManager.RelativeDirectory;
                    FlatRedBall.IO.FileManager.RelativeDirectory = FlatRedBall.IO.FileManager.GetDirectory(Gum.Managers.ObjectFinder.Self.GumProjectSave.FullFileName);
                    GumRuntime.ElementSaveExtensions.SetGraphicalUiElement(elementSave, this, RenderingLibrary.SystemManagers.Default);
                    FlatRedBall.IO.FileManager.RelativeDirectory = oldDirectory;
                }
            }
